/* Importing pictures here instead to save space in Desings.js file where its imported */
import "../Css/Design.css";
import Peng from "../Images/Peng.png";
import Pengs from "../Images/Pengs.jpg";
import Plak from "../Images/Plak.png";
import Light from "../Images/light.png";
import Mother100 from "../Images/Mother100.jpg";
import Car from "../Images/Car.gif";
import Stadium from "../Images/Stadium.jpeg";
import Tower from "../Images/Tower.jpeg";
import Ukraine from "../Images/Ukraine.jpg";
import Scholss from "../Images/Scholss.jpeg";
import Curch from "../Images/Curch.jpg";

export const IMAGES = [
  {
    src: Ukraine,
    thumbnail: Ukraine,
    thumbnailWidth: 4032,
    thumbnailHeight: 3024,
    caption: "Tower in Kamianets-Podilskyi."
  },
  {
    src: Tower,
    thumbnail: Tower,
    thumbnailWidth: 900,
    thumbnailHeight: 1125,
    caption: "Picture taked in Tallinn old town"
  },
  {
    src: Curch,
    thumbnail: Curch,
    thumbnailWidth: 1024,
    thumbnailHeight: 1501,
    caption: "A curch tower in Kamianets-Podilskyi"
  },
  {
    src: Scholss,
    thumbnail: Scholss,
    thumbnailWidth: 72,
    thumbnailHeight: 72,
    caption: "The Schloss fall manor in Keila-Joa"
  },
  {
    src: Stadium,
    thumbnail: Stadium,
    thumbnailWidth: 4032,
    thumbnailHeight: 3024,
    caption: "Photo taken during a music event on Tallinn song festival grounds"
  },
  {
    src: Peng,
    thumbnail: Peng,
    thumbnailWidth: 500,
    thumbnailHeight: 300,
    caption: "A logo I made for a custom hoodie)"
  },
  {
    src: Pengs,
    thumbnail: Pengs,
    thumbnailWidth: 574,
    thumbnailHeight: 797,
    caption: "Concept logo for the hoodie"
  },
  {
    src: Light,
    thumbnail: Light,
    thumbnailWidth: 1997,
    thumbnailHeight: 1798,
    caption: ""
  },
  {
    src: Mother100,
    thumbnail: Mother100,
    thumbnailWidth: 893,
    thumbnailHeight: 1148,
    caption:
      "A poster made to celebrate Estonian language 100th year anniversary"
  },
  {
    src: Plak,
    thumbnail: Plak,
    thumbnailWidth: 300,
    thumbnailHeight: 300,
    caption: "A school poster for student council"
  },
  {
    src: Car,
    thumbnail: Car,
    thumbnailWidth: 320,
    thumbnailHeight: 212,
    caption:
      "An animated car advertisment logo made with Flash that was meant for a website."
  }
];
